import "@openzeppelin/contracts/utils/Base64.sol";

contract TicketsBase is ERC721 {
    using Counters for Counters.Counter;
    using Strings for uint256;

    Counters.Counter private _tokenIds;
    
    struct TicketMetadata {
        string eventName;
        uint256 eventDate;
        string ticketType;
        string eventVenue;
        string metadataURI;
        string qrCodeURI;
        string verificationHash;
    }

    struct TicketSales {
        uint256 price;
        address owner;
        bool isSold;
        address currentOwner;
        uint256 mintedQuantity;
    }

    struct BatchTicketData {
        string metadataURI;
        string qrCodeURI;
        string verificationHash;
        bool isNonTransferable;
    }

    mapping(string => TicketMetadata) public ticketMetadata;
    mapping(string => TicketSales) public ticketSales;
    mapping(uint256 => string) public tokenIdToTicketId;
    mapping(uint256 => string) private tokenURIs;
    mapping(uint256 => BatchTicketData) private batchTokenData;
    mapping(uint256 => bool) public isNonTransferable;
    
    address public contractOwner;

    event TicketCreated(string ticketId, uint256 tokenId, string metadataURI, string qrCodeURI);
    event TicketPurchased(string ticketId, address buyer, uint256 tokenId);

    constructor() ERC721("EventTicket", "EVTK") {
        contractOwner = msg.sender;
    }

    modifier onlyOwner() {
        require(msg.sender == contractOwner, "Only contract owner");
        _;
    }

    function _beforeTokenTransfer(
        address from,
        address to,
        uint256 tokenId,
        uint256 batchSize
    ) internal virtual override {
        super._beforeTokenTransfer(from, to, tokenId, batchSize);
        if (from != address(0) && to != address(0)) {
            require(!isNonTransferable[tokenId], "Token is non-transferable");
        }
    }

    function initializeTicket(
        string memory ticketId,
        uint256 price,
        string memory eventName,
        uint256 eventDate,
        string memory ticketType,
        string memory eventVenue
    ) internal {
        if (bytes(ticketMetadata[ticketId].eventName).length == 0) {
            ticketMetadata[ticketId] = TicketMetadata({
                eventName: eventName,
                eventDate: eventDate,
                ticketType: ticketType,
                eventVenue: eventVenue,
                metadataURI: "",
                qrCodeURI: "",
                verificationHash: ""
            });

            ticketSales[ticketId] = TicketSales({
                price: price,
                owner: msg.sender,
                isSold: false,
                currentOwner: msg.sender,
                mintedQuantity: 0
            });
        }
    }

    function createTicketsInBatch(
        string memory ticketId,
        uint256 price,
        string memory eventName,
        uint256 eventDate,
        string memory ticketType,
        string memory eventVenue,
        BatchTicketData[] memory batchData
    ) public onlyOwner returns (uint256[] memory) {
        require(bytes(ticketMetadata[ticketId].eventName).length == 0, "Ticket exists");
        require(price > 0 && batchData.length > 0, "Invalid input");
        
        initializeTicket(ticketId, price, eventName, eventDate, ticketType, eventVenue);
        uint256[] memory newTokenIds = new uint256[](batchData.length);
        
        for (uint256 i = 0; i < batchData.length; i++) {
            require(bytes(batchData[i].metadataURI).length > 0 && 
                    bytes(batchData[i].qrCodeURI).length > 0 && 
                    bytes(batchData[i].verificationHash).length > 0, "Invalid data");
            
            _tokenIds.increment();
            uint256 newTokenId = _tokenIds.current();
            
            tokenIdToTicketId[newTokenId] = ticketId;
            tokenURIs[newTokenId] = batchData[i].metadataURI;
            batchTokenData[newTokenId] = batchData[i];
            _safeMint(msg.sender, newTokenId);
            
            ticketSales[ticketId].mintedQuantity++;
            newTokenIds[i] = newTokenId;
            isNonTransferable[newTokenId] = batchData[i].isNonTransferable;

            emit TicketCreated(ticketId, newTokenId, batchData[i].metadataURI, batchData[i].qrCodeURI);
        }
        return newTokenIds;
    }

    function getTicketBatchData(uint256 tokenId) public view returns (BatchTicketData memory) {
        require(_exists(tokenId), "Token does not exist");
        return batchTokenData[tokenId];
    }

    function buyTicket(string memory ticketId, uint256 quantity) public payable {
        require(bytes(ticketMetadata[ticketId].eventName).length > 0 && 
                !ticketSales[ticketId].isSold && 
                msg.sender != ticketSales[ticketId].currentOwner && 
                quantity > 0, "Invalid purchase");

        uint256[] memory purchasedTokenIds = new uint256[](quantity);
        uint256 foundCount = 0;
        uint256 totalTokens = _tokenIds.current();

        for (uint256 i = 1; i <= totalTokens && foundCount < quantity; i++) {
            if (keccak256(bytes(tokenIdToTicketId[i])) == keccak256(bytes(ticketId))) {
                if (!ticketSales[ticketId].isSold) {
                    purchasedTokenIds[foundCount] = i;
                    foundCount++;
                }
            }
        }

        require(foundCount == quantity, "Not enough available");

        for (uint256 i = 0; i < quantity; i++) {
            uint256 tokenId = purchasedTokenIds[i];
            address previousOwner = ticketSales[ticketId].currentOwner;
            require(ownerOf(tokenId) == previousOwner, "Owner mismatch");

            _approve(msg.sender, tokenId);
            _transfer(previousOwner, msg.sender, tokenId);

            if (isNonTransferable[tokenId]) {
                _approve(address(0), tokenId);
            }

            emit TicketPurchased(ticketId, msg.sender, tokenId);
        }

        ticketSales[ticketId].currentOwner = msg.sender;
        ticketSales[ticketId].isSold = true;
    }
}
